        this._super(w,h);

        var width=this.width-(2*this.stroke)+this.padding.left+this.padding.right;
        this.children.each(function(i,e){
            if(e.figure.isResizeable() && e.figure.isVisible()){
                e.figure.setDimension(width,e.figure.getHeight());
            }
        });

        return this;
